bool Mono_F19::init (const vector<string> &params){

  if ((params.size() != 2) && (params.size() != 1)) {
    cerr << "Error in init: Number of variables and mns parameter must be indicated" << endl;
    exit(-1);
  }

  setNumberOfVar(atoi(params[0].c_str()));
	if (params.size() == 2){
	  setMns(atof(params[1].c_str()));
	} else {
		setMns(0.75);
	}
	setNumberOfObj(NOBJ);
	return true;
}

void Mono_F19::divideFunctions(double *desp, double *part1, double *part2, int *psize1, int *psize2) {
  int shared;
  int rest, i, total;
  double *partrest;

	double m = getMns();
  if (m <= 0.5) {
     partrest = part2;
  }
  else {
     partrest = part1;
     m = 1 - m;
  }

  shared = (int) floor(getNumberOfVar() * m);
  rest = 2 * shared;

  for (i = 0; i < shared; i++) {
    part1[i] = desp[i * 2];
    part2[i] = desp[i * 2 + 1];
  }

  total = getNumberOfVar() - shared;

  for (i = 0; i < total - shared; i++) {
    partrest[i + shared] = desp[i + rest];
  }

  *psize1 = shared;
  *psize2 = getNumberOfVar() - shared;

  if (partrest == part1) {
    int temp = *psize1;
    *psize1 = *psize2;
    *psize2 = temp;
  }
}

long double Mono_F19::f_Schwefel2_22NoDesplazamiento(int dim, double *s){
	long double sum, currentGen, prod;
	sum = 0.0;
	prod = 1.0;

	for (int i = 0; i < dim; i++){
		currentGen = fabs(s[i]);
		sum += currentGen;
		prod *= currentGen;
	}
	return sum + prod;
}

long double Mono_F19::f_BohachevskyNoDesplazamiento(int dim, double *s) {   
	long double sum = 0.0;
	long double currentGen;
	long double nextGen;
	currentGen = s[0];
	for (int i = 1; i < dim; i++){
		nextGen = s[i];
		sum += currentGen * currentGen + 2.0 * nextGen * nextGen;
		double c1=cos(3.0 * M_PI * currentGen);
		double c2=cos(4.0 * M_PI * nextGen);
		sum += 0.7 -(0.3*c1+0.4*c2);
		currentGen = nextGen;
	}
	return sum;
}


void Mono_F19::evaluate (void) {
	double part1[getNumberOfVar()], part2[getNumberOfVar()];
	int size1, size2;
	double desp[getNumberOfVar()];
	long double f1, f2;
	for (int i = 0; i < getNumberOfVar(); i++) {
		desp[i] = getVar(i) - f19[i];
	}
	divideFunctions(desp, part1, part2, &size1, &size2);
	f1 = f_BohachevskyNoDesplazamiento(size1, part1);
	f2 = f_Schwefel2_22NoDesplazamiento(size2, part2);
	setObj(0, f1+f2);
}

// Clonacion
Individual* Mono_F19::clone (void) const{
  Individual *ind = new Mono_F19();
  ((Mono_F19*)ind)->setMns(getMns());
  return ind;
}
